  null,\n\t\"notes\": \"The Swan Lake National Wildlife Refuge Safety Plan discusses
  policies for the safety of the station employees, volunteers, and public. This plan
  seeks to identify and correct unsafe conditions and preclude unsafe acts through
  education and on-the-job training. Contained in this plan are Refuge safety objectives,
  an emergency contact listing, details on equipment and training, and a list of general
  hazardous conditions.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
